    <div id="containerHome">
      <div id="card">
        <h1>IronProfile</h1>
        <p>Today we will create an app<br/> with authoritation, adding <br/>some cool styles!</p>
        <br></br>
        <div>
        <Link to='/signup' className="boton">SignUp</Link>
        </div>
        <br/>
        <br/> 
        <Link to='/login' className="boton">Login</Link>
      </div>
    </div>
  );
}



export default Home;
